(66, 'Dewan Sebut Jatim Perlu 10 Mobil PCR untuk Percepatan Penanganan COVID-19', '- dprd jatim meminta pemprov mengajukan tambahan mobil pcr (polymerase chain reaction) untuk mempercepat penanganan covid-19. banyaknya mobil laboratorium pcr, akan mempermudah gugus tugas di jatim untuk segera mendeteksi para pdp. \"saya pikir perlu ditambah minimal ya ada 10 mobil-lah yang bisa mobile untuk keliling di 38 kab/kota di jatim. nantinya pengaturannya dilakukan oleh gugus tugas provinsi,\" kata wakil ketua dprd jatim, sahat tua simanjuntak di surabaya, minggu (31/5/2020). sahat menilai gugus tugas jatim membutuhkan tambahan mobil pcr, mengingat jumlah kasus pdp saat ini di jatim ada 6.595. sementara untuk yang masih diawasi ada sekitar 3.174 orang. \"sasarannya mobil lab pcr ini untuk kab/kota yang pdp-nya tinggi. sejauh ini di jatim sudah ada 2 mobil, kalau bisa ditambah,\" jelasnya. pascawali kota surabaya tri rismaharini marah terkait sabotase mobil lab pcr, politisi golkar ini melihat sering terjadi salah komunikasi antara pemkot surabaya dengan pemprov jatim terkait penanganan covid-19. \"mungkin bu wali kota tri rismaharini panik melihat peningkatan pasien covid-19 semakin tinggi di surabaya, apalagi sampai bapak presiden jokowi memberi atensi khusus ke surabaya,\" kata sahat. \"ini sudah psbb surabaya jilid 3, seharusnya pada saat psbb ke-1 dan ke-2 sudah bisa dilakukan tindakan-tindakan yang lebih serius, tapi saya lihat gubernur khofifah dan jajaran pemprov yang sangat aktif memberi support kab/kota. jadi masing-masing punya keinginan yang sama ingin berbuat yang terbaik buat masyarakat,\" imbuhnya. sahat menyarankan pemkot surabaya lebih pro-aktif berkoordinasi dengan pemprov jatim agar tidak terjadi salah paham. apalagi, pemprov jatim dan pemkot surabaya, jaraknya terbilang dekat. selain itu, untuk menghindari urusan yang bersifat politis, sahat menyarankan urusan birokrasi agar diperankan kepada sekdaprov dengan sekda kab/kota. \"mengingat jabatan kepala daerah itu bersifat politis karena dipilih dalam pilkada, maka urusan birokrasi sebaiknya diperankan sekda kab/kota untuk kordinasi dengan sekdaprov, agar terhindar dari para pihak yang akan mempolitisir,\" pungkasnya. (fat/fat)', 'https://news.detik.com/berita-jawa-timur/d-5035638/dewan-sebut-jatim-perlu-10-mobil-pcr-untuk-percepatan-penanganan-covid-19', 3),
